const CardData =[
    {
        img: goku,
        title:'Goku',
        description:"estamos probando el texto de la descripcion"
    },
    {
        img: kemonito,
        title:'Kemonito',
        description:"estamos probando el texto de la descripcion 2"
    },
    {
        img: monumento,
        title:'Monumento',
        description:"estamos probando el texto de la descripcion 3"
    },
];
export default CardData;
